import { FilmInfo } from "../../features/FilmInfo/FilmInfo";
import { RateStars } from "../Rate/Rate";
import { Input } from "../Input/Input";
import { FilmItem1 } from "../../features/films/components/FilmItem1";
import { FilmItem2 } from "../../features/films/components/FilmItem2";
import "../../styles/index.scss";

export const Fantasy = () => {
    return (
    <div>
         <div>
        <addToFavorite name='Sherlock Holmes'  image='https://static.hdrezka.ac/i/2013/7/30/ib112bef22285rd76q76o.jpg' desc='London, 1890 Five ritual murders have been committed in the city, and another
            one is about to happen. But the great detective Sherlock Holmes and his faithful
            friend and assistant Dr. Watson manage to prevent the crime.'/>
            <FilmInfo />
            <RateStars />
            <Input />
        </div>
        <FilmItem1 name='Spider Man. Away from home' desc='The events unfold around Peter Parker, who is trying to come to terms with the many
            changes that have occurred since the final battle of the Avengers.' image='https://static.hdrezka.ac/i/2022/2/2/e1d13f6b20b6fub59n85l.jpg' />
        <br />
        <Button />
        <FilmItem2 name='Doctor Strange' desc='Narcissistic and overly arrogant Stephen Strange, a talented neurosurgeon whose subtle
            filigree manipulations have saved more than one human life, many prophesied the
            glory of one of the greatest doctors of our time.' image='https://static.hdrezka.ac/i/2022/12/8/w1374bff4e71fey46d91c.jpeg' />
        <br />
        <Button />
    </div>
    );
};
